import React from 'react';
import Header from './header.js';

function Search_conts({list, word}) {
    console.log(list)
    list.map((str,idx) => {
        idx === 0 ? (
            str.map((s) => {
                    s === word ? (
                        console.log(word)
                    ) : (
                        console.log(s)
                    )
            })
        ) : (
            str.map((s) => {
                    s === word ? (
                        console.log(word)
                    ) : (
                        console.log(s)
                    )
            })
        )
    })
    return (
        <div class="div2">
            <ul>
            {list.map((str,idx) => {
                <li>
                idx === 0 ? (
                    {str.map((s) => {
                            s === word ? (
                                <span class = "div2-title bold">{{ s }}</span>
                            ) : (
                                <span class = "div2-title bold">{{ s }}</span>
                            )
                    })}
                ) : (
                    {str.map((s) => {
                            s === word ? (
                                <span class = "div2-cont bold">{{ s }}</span>
                            ) : (
                                <span class = "div2-cont bold">{{ s }}</span>
                            )
                    })}
                )
                </li>
            })}
            </ul>   
        </div>
    )
      
}


export default Search_conts;
